import { useTheme } from "@emotion/react";
import { LoadingButton } from "@mui/lab";
import { Card, Checkbox, Grid, TextField } from "@mui/material";
import { Box, styled } from "@mui/system";
import { Paragraph } from "app/components/Typography";
import useAuth from "app/hooks/useAuth";
import { Formik } from "formik";
import { useState } from "react";
import { NavLink } from "react-router-dom";
import * as Yup from "yup";
import { useNavigate } from "react-router-dom";

const FlexBox = styled(Box)(() => ({ display: "flex", alignItems: "center" }));

const JustifyBox = styled(FlexBox)(() => ({ justifyContent: "center" }));

const ContentBox = styled(JustifyBox)(() => ({
  height: "100%",
  padding: "32px",
  background: "rgba(0, 0, 0, 0.01)",
}));

const JWTRegister = styled(JustifyBox)(() => ({
  background: "#1A2038",
  minHeight: "100vh !important",
  "& .card": {
    maxWidth: 800,
    minHeight: 400,
    margin: "1rem",
    display: "flex",
    borderRadius: 12,
    alignItems: "center",
  },
}));

// inital login credentials
const initialValues = {
  full_name: "",
  user_name: "",
  email: "",
  password: "",
  confirm_password: "",
  contact_number: "",
  remember: true,
};


const ViewProfile=()=>{
        const theme = useTheme();
        const { register } = useAuth();
        const [loading, setLoading] = useState(false);
        const [image, setImage] = useState("");
        const navigate = useNavigate()

        const handleFormSubmit = (values) => {
          setLoading(true);
          const formData = new FormData();
          formData.append("full_name", values.full_name);
          formData.append("user_name", values.user_name);
          formData.append("email", values.email);
          if (values.confirm_password === values.password) {
            formData.append("password", values.password);
          };
          formData.append("contact_number", values.contact_number);
          formData.append("profile_image", image);
          try {
            register(formData);
            navigate("dashboard/default")
            setLoading(false);

          } catch (e) {
            console.log(e);
            setLoading(false);
          }
        };

    const [state, setState] = useState([])


    const Data = async ()=>{

        const users = await getUsers()
       setState(users.data.data)
    }
    useEffect(()=>{
        Data();
    })

    return(
        <Container>
      <SimpleCard>
        <Box width="100%" overflow="auto">
          <StyledTable>
            <TableHead>
              <TableRow>
                <TableCell align="left">Id</TableCell>
                <TableCell align="left">Name</TableCell>
                <TableCell align="center">Email</TableCell>
                <TableCell align="center">User Name</TableCell>
                <TableCell align="center">Contact Number</TableCell>
                <TableCell align="center">Action</TableCell>
              </TableRow>
            </TableHead>

            <TableBody>
              {state.map((userList, index) => (
                <TableRow key={index}>
                  <TableCell align="left">{index + 1}</TableCell>
                  <TableCell align="left">{userList.full_name}</TableCell>
                  <TableCell align="center">{userList.email}</TableCell>
                  <TableCell align="center">{userList.user_name}</TableCell>
                  <TableCell align="center">
                    {userList.contact_number}
                  </TableCell>
                  <TableCell align="center">
                    <Fab color="secondary" aria-label="Edit" className="button">
                      <Link to={`/editUsers/${userList._id}`}>
                        <Icon>edit_icon</Icon>
                      </Link>
                    </Fab>

                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </StyledTable>
        </Box>
      </SimpleCard>
    </Container>

    )
}
export default ViewProfile;
